                <span className='text-light bg-dark p-2 time-gestion'>{valueDate.toLocaleDateString("es-AR", options)}</span>
            </article>
            <AddProductBusiness rolSeller={cookies && cookies.user && cookies.user.rol}/>
            </>
        )
    }
    return(<></>)
}


export default MyBusinessComp
